import "./App.css";

const App = () => {
  return (
    <div className='app_wrapper'>
      <header className='header'>
        <img src="data:image/png;base64," />
      </header>
      <nav className='nav'>
        <div>
          <a></a>
        </div>
        <div>
          Massages
        </div>
      </nav>
      <div className='content'>
        Main conent
      </div>
    </div>
  );
};

export default App;
